import React, { useState } from 'react'
import CriarProcesso from '../components/CriarProcesso'
import Axios from 'axios'
import '../assets/css/base/base.css'


const Home = () => {

  const [cd_prf_und, setCd_prf_und] = useState("");
  const [cd_agrup_prc, setCd_agrup_prc] = useState("");
  const [cd_tip_prc, setCd_tip_prc] = useState("");
  const [CD_TIP_ATVD, setCD_TIP_ATVD] = useState("");
  const [cd_detalhe_ocr, setCd_detalhe_ocr] = useState("");
  const [cd_cli, setCd_cli] = useState("");
  const [identific1, setIdentific1] = useState("");
  const [identific2, setIdentific2] = useState("");
  const [identific3, setIdentific3] = useState("");

  const [listaProcessos, setListaProcessos] = useState([]);

  const listarProcessos = () => {
    console.log("clicou");
    Axios.get('http://localhost:5000/listaProcessos').then((response) => {
      setListaProcessos(response.data)
    })
  }

  return (
    <main>
      <div className="container">
        <h2 className="titulo-pagina">Lista de Processos</h2>
      </div>
      <CriarProcesso />
      <div className="container">
        <button className="botao" onClick={listarProcessos}>Listar Processos</button>

        {listaProcessos.map((val, key) => {
          return 
          <div>
            {val.cd_prf_und}
          </div>
        })}

      </div>

    </main>
  )
}

export default Home
